import React from 'react';

function Languages() {
  return (
    <div>
      <h3>Languages</h3>
      <ul className="bulleted-list">
        <li style={{ listStyleType: 'disc' }}>
          <strong>English | Proficient</strong>
          <ul className="bulleted-list">
            <li style={{ listStyleType: 'circle' }}>TOEIC (950/990) , OPIc (IH)</li>
          </ul>
        </li>
      </ul>
      <ul className="bulleted-list">
        <li style={{ listStyleType: 'disc' }}><strong>Korean | Native</strong></li>
      </ul>
    </div>
  );
}

export default Languages;
